import * as React from "react";
import Video from "../util/Video";

/**
 * A video tile displayed in the main section
 * thumbnail res: 1280x720
 */

type VideoTileProps = {
  video: Video;
};

/**
 * a music video tile displays:
 * title
 * artist
 * thumbnail,
 * views,
 * uploaded time
 */

export default function VideoTile({ video }: VideoTileProps) {
  return (
    <>
      <div>
        <div className="thumbnail-wrapper">
          <img
            className="thumbnail"
            src={video.thumbnailURI}
            alt={video.title}
          />
        </div>
        <div className="tile-info">
          <div className="tile-title">{video.title}</div>
          <div className="tile-artist">{video.artist}</div>
          <div className="tile-uploaded">{}</div>
          <div className="tile-views">{video.views}</div>
        </div>
      </div>
    </>
  );
}
